18\u0441\u043a\u0435\u043b\u0435\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0423\u043d\u043a\u044f\u0440-\u0418\u0441\u043a\u0435\u043b\u0435\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a> \u043e \u043c\u0438\u0440\u0435, \u0434\u0440\u0443\u0436\u0431\u0435 \u0438 \u043e\u0431\u043e\u0440\u043e\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u043c \u0441\u043e\u044e\u0437\u0435 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0435\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1853_%D0%B3%D0%BE%D0%B4\" title=\"1853 \u0433\u043e\u0434\">1853<\/a>&#160;\u2014 \u0432 \u0422\u043e\u043a\u0438\u0439\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435 \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0441\u044f \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D1%80%D0%B8,_%D0%9C%D1%8D%D1%82%D1%8C%D1%8E_%D0%9A%D1%8D%D0%BB%D0%B1%D1%80%D0%B5%D0%B9%D1%82_(%D0%BA%D0%BE%D0%BC%D0%BC%D0%BE%D0%B4%D0%BE%D1%80_%D0%92%D0%9C%D0%A4_%D0%A1%D0%A8%D0%90)\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0440\u0438, \u041c\u044d\u0442\u044c\u044e \u041a\u044d\u043b\u0431\u0440\u0435\u0439\u0442 (\u043a\u043e\u043c\u043c\u043e\u0434\u043e\u0440 \u0412\u041c\u0424 \u0421\u0428\u0410)\">\u041c\u044d\u0442\u044c\u044e \u041f\u0435\u0440\u0440\u0438<\/a>, \u043e\u0442 \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u0432\u0448\u0438\u0439 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u0434\u043e \u043a\u043e\u043d\u0446\u0430 \u0433\u043e\u0434\u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u0441 \u0410\u043c\u0435\u0440\u0438\u043a\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1889_%D0%B3%D0%BE%D0%B4\" title=\"1889 \u0433\u043e\u0434\">1889<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Wall_Street_Journal\" title=\"The Wall Street Journal\">The Wall Street Journal<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u043e \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u0435 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u0435\u0439 \u0432 \u0433\u043e\u0440\u043e\u0434\u0430\u0445&#160;\u2014 10 \u043a\u043c\/\u0447.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0441\u0430\u043c\u043e\u0433\u043e \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0433\u043e \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0432\u0430\u0440\u044c\u0435\u0442\u0435 \u043f\u0435\u0440\u0432\u043e\u0439 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u044b XX \u0432\u0435\u043a\u0430 \u00abZiegfeld Follies\u00bb, \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u0438\u043c\u043f\u0440\u0435\u0441\u0430\u0440\u0438\u043e \u0424\u043b\u043e\u0440\u0435\u043d\u0446\u0435\u043c \u0417\u0438\u0433\u0444\u0435\u043b\u044c\u0434\u043e\u043c (Florenz Ziegfeld).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0443\u043a\u0430\u0437 \u043e \u043c\u043e\u0431\u0438\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u043d\u0430 \u043f\u0440\u0438\u043d\u0443\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0440\u0430\u0431\u043e\u0442\u044b 400 \u0442\u044b\u0441. \u0436\u0438\u0442\u0435\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%BA%D0%B5%D1%81%D1%82%D0%B0%D0%BD_(%D1%80%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD)\" class=\"mw-redirect\" title=\"\u0422\u0443\u0440\u043a\u0435\u0441\u0442\u0430\u043d (\u0440\u0435\u0433\u0438\u043e\u043d)\">\u0422\u0443\u0440\u043a\u0435\u0441\u0442\u0430\u043d\u0430<\/a> \u0438 \u0441\u0442\u0435\u043f\u043d\u044b\u0445 \u043e\u0431\u043b\u0430\u0441\u0442\u0435\u0439. \u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u043a\u0430\u0437\u0430\u0445\u0441\u043a\u0438\u0445 \u043f\u043b\u0435\u043c\u0451\u043d \u0431\u044b\u043b\u043e \u0436\u0435\u0441\u0442\u043e\u043a\u043e \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> \u0441\u043e\u0437\u0434\u0430\u043d \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0421\u0435\u043d\u0430\u0442 \u0423\u043a\u0440\u0430\u0438\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u043a\u043e\u043b\u043e\u043d\u0438\u044f \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0435\u043d\u0438\u044f\">\u041a\u0435\u043d\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u043d\u0430 \u0431\u044b\u0432\u0448\u0435\u043c \u0425\u043e\u0434\u044b\u043d\u0441\u043a\u043e\u043c \u0430\u044d\u0440\u043e\u0434\u0440\u043e\u043c\u0435 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u044b \u043e\u043f\u044b\u0442\u044b \u043f\u043e \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044e \u0430\u0432\u0438\u0430\u0446\u0438\u0438 \u0434\u043b\u044f \u0431\u043e\u0440\u044c\u0431\u044b \u0441 \u0432\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 (\u043b\u0451\u0442\u0447\u0438\u043a \u041d.&#160;\u041f.&#160;\u0418\u043b\u044c\u0437\u0438\u043d).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a><ul><li>\u0423\u043a\u0430\u0437\u043e\u043c \u041f\u0440\u0435\u0437\u0438\u0434\u0438\u0443\u043c\u0430 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0421\u043e\u0432\u0435\u0442\u0430 \u0421\u0421\u0421\u0420 \u0432\u0432\u0435\u0434\u0435\u043d\u043e \u043f\u043e\u0447\u0451\u0442\u043d\u043e\u0435 \u0437\u0432\u0430\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_%C2%AB%D0%9C%D0%B0%D1%82%D1%8C-%D0%B3%D0%B5%D1%80%D0%BE%D0%B8%D0%BD%D1%8F%C2%BB\" title=\"\u0417\u0432\u0430\u043d\u0438\u0435 \u00ab\u041c\u0430\u0442\u044c-\u0433\u0435\u0440\u043e\u0438\u043d\u044f\u00bb\">\u041c\u0430\u0442\u044c-\u0433\u0435\u0440\u043e\u0438\u043d\u044f<\/a>\u00bb \u0438 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u044b \u043e\u0440\u0434\u0435\u043d \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%BB%D0%B0%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u041c\u0430\u0442\u0435\u0440\u0438\u043d\u0441\u043a\u0430\u044f \u0441\u043b\u0430\u0432\u0430\">\u041c\u0430\u0442\u0435\u0440\u0438\u043d\u0441\u043a\u0430\u044f \u0441\u043b\u0430\u0432\u0430<\/a>\u00bb \u0438 \u043c\u0435\u0434\u0430\u043b\u044c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C_%D0%BC%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D1%81%D1%82%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u041c\u0435\u0434\u0430\u043b\u044c \u043c\u0430\u0442\u0435\u0440\u0438\u043d\u0441\u0442\u0432\u0430\">\u041c\u0435\u0434\u0430\u043b\u044c \u043c\u0430\u0442\u0435\u0440\u0438\u043d\u0441\u0442\u0432\u0430<\/a>\u00bb.<\/li><li>\u0412\u044b\u043f\u0443\u0441\u043a \u043f\u0435\u0440\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C\" title=\"\u0410\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\">\u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044f<\/a> \u043d\u0430 \u044d\u0432\u0430\u043a\u0443\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u043c \u0432 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%B0%D1%81%D1%81\" title=\"\u041c\u0438\u0430\u0441\u0441\">\u041c\u0438\u0430\u0441\u0441<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D0%B1%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0424\u0430\u0431\u0440\u0438\u043a\u0430\">\u0437\u0430\u0432\u043e\u0434\u0435<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%98%D0%A1\" class=\"mw-redirect\" title=\"\u0417\u0418\u0421\">\u0417\u0418\u0421<\/a>\u00bb (\u0417\u0430\u0432\u043e\u0434\u0435 \u0438\u043c\u0435\u043d\u0438 \u0418.&#160;\u0412.&#160;\u0421\u0442\u0430\u043b\u0438\u043d\u0430).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u043f\u043e\u0441\u043b\u0435 \u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B8%D0%B7%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D1%8F\" title=\"\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0430\u0441\u0442\u0440\u043e\u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u044f\">\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0430\u0441\u0442\u0440\u043e\u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u044f<\/a> \u0410\u041d \u0421\u0421\u0421\u0420 (\u041a\u0410\u041e \u0431\u044b\u043b\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u043d\u0430 \u0431\u0430\u0437\u0435 \u0447\u0430\u0441\u0442\u043d\u043e\u0439 \u043b\u044e\u0431\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0439 \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u0438, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900 \u0433\u043e\u0434\u0443<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u0441\u043b\u0435\u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%82%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0412\u0435\u0440\u0442\u043e\u043b\u0451\u0442\">\u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442<\/a>&#160;\u2014 \u0442\u0440\u0451\u0445\u043c\u0435\u0441\u0442\u043d\u044b\u0439 \u0411\u043e\u0440\u0433\u0432\u0430\u0440\u0442 \u00ab\u041a\u043e\u043b\u0438\u0431\u0440\u0438 I\u00bb, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85%D0%BE%D0%BC_%D0%A4%D0%BE%D0%BA%D0%BA%D0%B5&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445\u043e\u043c \u0424\u043e\u043a\u043a\u0435 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0413\u0435\u043d\u0440\u0438\u0445\u043e\u043c \u0424\u043e\u043a\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-8_%D0%BF%D0%BE%D0%B4_%D0%94%D0%B6%D1%83%D0%BD%D0%BD%D0%B0%D1%80%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-8 \u043f\u043e\u0434 \u0414\u0436\u0443\u043d\u043d\u0430\u0440\u043e\u043c\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 Douglas DC-8<\/a> \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%94%D0%B6%D1%83%D0%BD%D0%BD%D0%B0%D1%80&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0414\u0436\u0443\u043d\u043d\u0430\u0440 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0414\u0436\u0443\u043d\u043d\u0430\u0440\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u044f<\/a>). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 94 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2%D0%BE_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC%D0%B5\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0432\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0435\">\u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u043d\u0430\u0447\u0430\u0442 \u0432\u044b\u0432\u043e\u0434 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u042e\u0436\u043d\u044b\u0439 \u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u042e\u0436\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u0447\u0435\u0440\u0435\u0437 \u0442\u0440\u0438 \u0441 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u043e\u0439 \u0433\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D1%81%D0%BE%D0%BD,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_%D0%9C%D0%B8%D0%BB%D1%85%D0%B0%D1%83%D0%B7\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u0441\u043e\u043d, \u0420\u0438\u0447\u0430\u0440\u0434 \u041c\u0438\u043b\u0445\u0430\u0443\u0437\">\u041d\u0438\u043a\u0441\u043e\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0421\u0421\u0421\u0420 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 3 \u043b\u0435\u0442 \u0437\u0430\u043a\u0443\u043f\u0438\u0442 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0435 \u0437\u0435\u0440\u043d\u043e \u043d\u0430 \u0441\u0443\u043c\u043c\u0443 750 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u043e\u0432 \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%9A_%D0%9A%D0