0433\u043e\u0434\">1980<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-154_%D0%B2_%D0%90%D0%BB%D0%BC%D0%B0-%D0%90%D1%82%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-154 \u0432 \u0410\u043b\u043c\u0430-\u0410\u0442\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0422\u0443-154<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%BC%D0%B0-%D0%90%D1%82%D0%B0\" title=\"\u0410\u043b\u043c\u0430-\u0410\u0442\u0430\">\u0410\u043b\u043c\u0430-\u0410\u0442\u0435<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 166 \u0447\u0435\u043b\u043e\u0432\u0435\u043a&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\">\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 \u0432 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%BA%D0%BE%D0%BC\" title=\"\u041b\u0435\u043d\u043a\u043e\u043c\">\u041b\u0435\u043d\u043a\u043e\u043c\u0435<\/a>\u00bb \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043c\u044e\u0437\u0438\u043a\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BD%D0%BE%D0%BD%D0%B0_%D0%B8_%D0%90%D0%B2%D0%BE%D1%81%D1%8C_(%D1%80%D0%BE%D0%BA-%D0%BE%D0%BF%D0%B5%D1%80%D0%B0)\" class=\"mw-redirect\" title=\"\u042e\u043d\u043e\u043d\u0430 \u0438 \u0410\u0432\u043e\u0441\u044c (\u0440\u043e\u043a-\u043e\u043f\u0435\u0440\u0430)\">\u00ab\u042e\u043d\u043e\u043d\u0430\u00bb \u0438 \u00ab\u0410\u0432\u043e\u0441\u044c\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u043d\u043e\u0432\u043e\u0435 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%81%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u041f\u0430\u0441\u043f\u043e\u0440\u0442\">\u043f\u0430\u0441\u043f\u043e\u0440\u0442\u0435<\/a> (\u0435\u0433\u043e \u043e\u0431\u044f\u0437\u0430\u043d\u044b \u0438\u043c\u0435\u0442\u044c \u0432\u0441\u0435 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0435, \u0434\u043e\u0441\u0442\u0438\u0433\u0448\u0438\u0435 14 \u043b\u0435\u0442).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003_%D0%B3%D0%BE%D0%B4\" title=\"2003 \u0433\u043e\u0434\">2003<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Boeing_737_%D0%BF%D0%BE%D0%B4_%D0%9F%D0%BE%D1%80%D1%82-%D0%A1%D1%83%D0%B4%D0%B0%D0%BD%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Boeing 737 \u043f\u043e\u0434 \u041f\u043e\u0440\u0442-\u0421\u0443\u0434\u0430\u043d\u043e\u043c\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 Boeing 737<\/a> \u044e\u0436\u043d\u0435\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82-%D0%A1%D1%83%D0%B4%D0%B0%D0%BD\" title=\"\u041f\u043e\u0440\u0442-\u0421\u0443\u0434\u0430\u043d\">\u041f\u043e\u0440\u0442-\u0421\u0443\u0434\u0430\u043d\u0430<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 117 \u0447\u0435\u043b\u043e\u0432\u0435\u043a&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B4%D0%B0%D0%BD\" title=\"\u0421\u0443\u0434\u0430\u043d\">\u0421\u0443\u0434\u0430\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u0438\u044f\">\u0427\u0435\u0448\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a> \u0441\u0442\u0430\u043b\u0430 18-\u043c \u0447\u043b\u0435\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%B0%D0%B3%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0435 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e\">\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2011_%D0%B3%D0%BE%D0%B4\" title=\"2011 \u0433\u043e\u0434\">2011<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BB%D0%B0%D0%BD%D1%82%D0%B8%D1%81_STS-135\" class=\"mw-redirect\" title=\"\u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0441 STS-135\">\u0441\u0442\u0430\u0440\u0442<\/a> \u0448\u0430\u0442\u0442\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BB%D0%B0%D0%BD%D1%82%D0%B8%D1%81\" title=\"\u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0441\">\u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0441<\/a>\u00bb. \u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u043f\u043e\u043b\u0451\u0442 \u0448\u0430\u0442\u0442\u043b\u0430 \u00ab\u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0441\u00bb, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 \u044d\u043a\u0441\u043f\u043b\u0443\u0430\u0442\u0430\u0446\u0438\u044e \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B5%D0%B9%D1%81_%D1%88%D0%B0%D1%82%D1%82%D0%BB\" title=\"\u0421\u043f\u0435\u0439\u0441 \u0448\u0430\u0442\u0442\u043b\">Space Shuttle<\/a>\u00bb .<\/li><\/ul><h2>"}